import avatar from "../../assets/avatar.jpg";
import Post from "../Post/Post";
import "./Main.scss";

function Main() {
  return (
    <div className="main">
      <div className="feed">
        <div className="stories">
          <div className="story-list">
            <Story img={avatar} username={"vefa.ozlu"} />
          </div>
        </div>
        <div className="posts">
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
          <Post />
        </div>
      </div>
      <div className="suggestions"></div>
    </div>
  );
}

export default Main;

function Story({ img, username, seen = false }) {
  return (
    <div className="Story">
      <div className={seen ? "seen_image" : "unseen_image"}>
        <img src={img} />
      </div>
      <span className={seen ? "seen_text" : "unseen_text"}>{username}</span>
    </div>
  );
}
